description:
Mamula (2014)+Prijevod

Rezija: Milan Todorovic





Uloge: Franco Nero, Kristina Klebe, Dragan Micanovic, Natalie Burn, Miodrag Miki Krstovic, Slobodan Stefanovic, Sofija Rajovic, Jelena Rakocevic, Zorana Kostic Obradovic, Janko Cekic, Miki Peric...

Dve Americke turistkinje dolaze u Crnu Goru da posete svog starog prijatelja. Nakon nekoliko dana uzivanja, druzina odlucuje da poseti napusteno ostrvo Mamula, iako su upozoreni na cudna desavanja i legende koje kruze o tom mestu. Tamo zaticu misterioznog ribara koji drzi zatocenu prelepu devojku. 
